import base64

import js2py


def extract_function(encoded_string: str):
    decoded = base64.b64decode(encoded_string)
    return js2py.eval_js(decoded.decode())


def check_one(secret_key):
    basic_function = b""
    return extract_function(basic_function)(secret_key)


if __name__ == "__main__":
    print(check_one(input(">")))
